-- =============================================
-- Author:		<Author,,Name>
-- Create date: <Create Date,,>
-- Description:	<Description,,>
-- =============================================
CREATE PROCEDURE [dbo].[Import] 
	-- Add the parameters for the stored procedure here
	@YEAR SMALLINT,
	@POSITION SMALLINT,
	@ARTIST NVARCHAR(100),
	@TITLE NVARCHAR(100),
	@PUBYEAR SMALLINT = 0
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	DECLARE @ARTISTID INT
	DECLARE @SONGID INT
	
	-- Check for new artist
	IF (SELECT COUNT(*) FROM ARTIEST WHERE NAAM = @ARTIST) = 1
	SET @ARTISTID = (SELECT ARTIESTID FROM ARTIEST WHERE NAAM = @ARTIST)
	ELSE
	BEGIN
		INSERT INTO ARTIEST(NAAM) VALUES(@ARTIST)
		SET @ARTISTID = @@IDENTITY
	END

	-- Check for new song
	IF (SELECT COUNT(*) FROM SONG WHERE titel = @TITLE AND artiestid = @ARTISTID) = 1
	SET @SONGID = (SELECT SONGID FROM SONG WHERE Titel = @TITLE AND artiestid = @ARTISTID)
	ELSE
	BEGIN
		INSERT INTO SONG(ARTIESTID , TITEL , JAAR) VALUES(@ARTISTID , @TITLE , @PUBYEAR)
		SET @SONGID = @@IDENTITY
	END

	-- Add song to list
	IF (SELECT COUNT(*) FROM LIJST WHERE songid = @SONGID AND top2000jaar = @YEAR) = 0
	BEGIN
	INSERT INTO LIJST (SONGID , TOP2000JAAR , POSITIE)
	VALUES (@SONGID , @YEAR , @POSITION)
	END
END
GO
